import React from "react";

const ClubList = (props) => {
  const clubItems = props.list.map((item) => {
    return <p>{item.name}</p>;
  });
  return (
    <div>
      <h1>Listado de clubes</h1>
      {clubItems}
    </div>
  );
};

export default ClubList;
